import React, { useState } from 'react';
import './SlideImg.css';

export default function SlideImag(){
    const [index, setInputData]=useState(0);
    const imageArr=[
        
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,"
            
    ,
    ]
  
    function handlechangeImg(){
       const len=imageArr.length;
        if(index+1===len)
        {
           setInputData((index+1)% imageArr.length);
        }
        else{
            setInputData(index+1);
        }
    }

    return(
        <div className='container'>
        <div className="left">
            <img src={imageArr[index]}/>
        </div>

        <div className='right'>
            <button onClick={handlechangeImg}>Change Pic</button>
        </div>
        </div>
    )
}